import './App.css';
import Post from './Components/Post';


function App() {

  const arr = [{name: 'fds',body: 'dfs'},{name:'fdsf',body:'fds'},{name: 'dasf',body: 'hte'}];
  return (

    <div className="App">
      {arr.map((val,index) => {
        return <div key={index}>
         <Post name = {val.name} body = {val.name}/>
        </div>
      })}
    </div>
  );
}

export default App;
